import React, { useEffect, useState } from 'react';
import { useParams } from 'react-router-dom';
import HeroSection10 from '../HeroSection10';

export default function Rezerwacja() {
  const { id } = useParams(); // Pobranie ID pojazdu z URL
  const [vehicle, setVehicle] = useState(null); // Stan na dane pojazdu

  useEffect(() => {
    // Pobranie danych pojazdu z API lub innego źródła danych
    fetch(`http://192.168.8.148:8000/zarzadzanie_pojazdami/pojazd/${id}`)
      .then(response => response.json())
      .then(data => setVehicle(data))
      .catch(error => console.error('Error:', error));
  }, [id]); // Efekt zależny od zmiany ID

  // Renderowanie komponentu HeroSection10 z danymi pojazdu
  return vehicle ? <HeroSection10 vehicle={vehicle} /> : <p>Ładowanie danych pojazdu...</p>;
}
